import math

def is_prime(num):
    if num < 1:
        return False
    if num == 2:
        return True
    if num % 2 == 0:
        return False
    sqrt_n = int(math.sqrt(num)) + 1
    for i in range(3, sqrt_n, 2):
        if num % i == 0:
            return False
    return True

def fibonacci(n):
    if n <= 0:
        return 0
    elif n == 1:
        return 1
    else:
        (a, b) = (0, 1)
        for _ in range(n - 1):
            (a, b) = (b, a + b)
        return b

def prime_fibonacci(n):
    i = 1
    results = []
    while len(results) < n:
        fib = fibonacci(i)
        if is_prime(fib):
            results.append(fib)
        i += 1
    return results

